INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(1, '201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh', 'Bệnh viện Chợ Rẫy', '**Địa chỉ bệnh viện:**\n\n201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh\n\n**Thời gian làm việc:**\n\nBệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:\n\n* Thứ 2 đến thứ 6: từ 7h – 16h\n* Thứ 7: từ 7h – 11h\n\n**Lưu ý thông tin đặt lịch:**\n\n\n\n* Vui lòng kiểm tra kĩ thông tin cá nhân (họ tên, giới tính, năm sinh, địa chỉ, BHYT) trước khi xác nhận đặt lịch khám để tránh sai sót và tiết kiệm thời gian (Bệnh viện không chấp nhận với lịch sai thông tin) \n* Trường hợp đặt sai thông tin, vui lòng đặt lại bằng số điện thoại khác (bắt buộc)', '<p><strong>Địa chỉ bệnh viện:</strong></p>\n<p>201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<p>Bệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:</p>\n<ul>\n<li>Thứ 2 đến thứ 6: từ 7h – 16h</li>\n<li>Thứ 7: từ 7h – 11h</li>\n</ul>\n<p><strong>Lưu ý thông tin đặt lịch:</strong></p>\n<ul>\n<li>Vui lòng kiểm tra kĩ thông tin cá nhân (họ tên, giới tính, năm sinh, địa chỉ, BHYT) trước khi xác nhận đặt lịch khám để tránh sai sót và tiết kiệm thời gian (Bệnh viện không chấp nhận với lịch sai thông tin)</li>\n<li>Trường hợp đặt sai thông tin, vui lòng đặt lại bằng số điện thoại khác (bắt buộc)</li>\n</ul>\n', 'data:image/jpeg;base64,', '2024-08-21 13:27:35', '2024-08-21 13:27:35');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(2, 'SS1N Đường Hồng Lĩnh, Phường 15, Quận 10, TPHCM', 'Phòng khám Da liễu Doctor Scar', '\n## GIỚI THIỆU CHUNG\n\n\nPhòng khám Da liễu Doctor Scar - Chuyên trị sẹo rỗ là phòng khám da liễu đầu tiên và duy nhất chuyên điều trị sẹo rỗ tại Việt Nam. Với đội ngũ Bác sĩ Da Liễu đầu ngành sẹo rỗ kết hợp với các phương pháp điều trị hiện đại nhất. Đến nay, Phòng khám đã điều trị sẹo rỗ thành công cho hơn 50.000 khách hàng & giúp họ lấy lại tự tin trong cuộc sống. Phòng khám cam kết mang đến cho Khách hàng giải pháp điều trị Hiệu quả nhất - An toàn nhất - Chi phí hợp lý nhất. Hãy đồng hành cùng Doctor Scar để tạm biệt nỗi lo mang tên SẸO RỖ.\nMột số bác sĩ giỏi nhiều năm kinh nghiệm tại phòng khám như: \n\n* Bác sĩ Trương Thị Ngọc Bửu: Hơn 10 năm chuyên môn trong điều trị các vấn đề về da như sẹo rỗ, mụn, viêm da. Từng công tác tại bệnh viện da liễu Trung Ương Quy Hòa; Đơn vị da liễu thẩm mỹ da Bệnh viện Nguyễn Tri Phương cùng nhiều phòng khám da liễu, spa, clinic,...\n* Bác sĩ Nguyễn Thị Diệu Hương: Hơn 5 năm kinh nghiệm chuyên sâu trong điều trị các vấn đề về sẹo rỗ, sẹo lồi, mụn trứng cá, nám da,..Từng công tác tại nhiều bệnh viện Đa khoa Xuyên Á, bệnh viện Đại học y dược Shing Mark, nhiều phòng khám da liễu, spa, clinic,...\n* Bác sĩ Nguyễn Mạc Thanh Thanh: Nhiều năm kinh nghiệm chuyên sâu về sẹo rỗ. Bác sĩ Nguyễn Mạc Thanh Thanh có chuyên môn sâu về sẹo rỗ và được đánh giá là bác sĩ đạt hiệu quả điều trị cao nhất (dựa vào kết quả khảo sát khách hàng trong quý l/2022\n\n**Địa chỉ:** SS1N Hồng Lĩnh, Phường 15, Quận 10 (Gần Công an Phường 15)\n\n\nThời gian làm việc: \n\n* Thứ 2 - Thứ 6: 11h - 20h\n* Thứ 7 & Chủ nhật: 9h - 18h\n\n**Hình thức thanh toán:** Chuyển khoản & Tiền mặt', '<h2>GIỚI THIỆU CHUNG</h2>\n<p>Phòng khám Da liễu Doctor Scar - Chuyên trị sẹo rỗ là phòng khám da liễu đầu tiên và duy nhất chuyên điều trị sẹo rỗ tại Việt Nam. Với đội ngũ Bác sĩ Da Liễu đầu ngành sẹo rỗ kết hợp với các phương pháp điều trị hiện đại nhất. Đến nay, Phòng khám đã điều trị sẹo rỗ thành công cho hơn 50.000 khách hàng &amp; giúp họ lấy lại tự tin trong cuộc sống. Phòng khám cam kết mang đến cho Khách hàng giải pháp điều trị Hiệu quả nhất - An toàn nhất - Chi phí hợp lý nhất. Hãy đồng hành cùng Doctor Scar để tạm biệt nỗi lo mang tên SẸO RỖ.\nMột số bác sĩ giỏi nhiều năm kinh nghiệm tại phòng khám như:</p>\n<ul>\n<li>Bác sĩ Trương Thị Ngọc Bửu: Hơn 10 năm chuyên môn trong điều trị các vấn đề về da như sẹo rỗ, mụn, viêm da. Từng công tác tại bệnh viện da liễu Trung Ương Quy Hòa; Đơn vị da liễu thẩm mỹ da Bệnh viện Nguyễn Tri Phương cùng nhiều phòng khám da liễu, spa, clinic,...</li>\n<li>Bác sĩ Nguyễn Thị Diệu Hương: Hơn 5 năm kinh nghiệm chuyên sâu trong điều trị các vấn đề về sẹo rỗ, sẹo lồi, mụn trứng cá, nám da,..Từng công tác tại nhiều bệnh viện Đa khoa Xuyên Á, bệnh viện Đại học y dược Shing Mark, nhiều phòng khám da liễu, spa, clinic,...</li>\n<li>Bác sĩ Nguyễn Mạc Thanh Thanh: Nhiều năm kinh nghiệm chuyên sâu về sẹo rỗ. Bác sĩ Nguyễn Mạc Thanh Thanh có chuyên môn sâu về sẹo rỗ và được đánh giá là bác sĩ đạt hiệu quả điều trị cao nhất (dựa vào kết quả khảo sát khách hàng trong quý l/2022</li>\n</ul>\n<p><strong>Địa chỉ:</strong> SS1N Hồng Lĩnh, Phường 15, Quận 10 (Gần Công an Phường 15)</p>\n<p>Thời gian làm việc:</p>\n<ul>\n<li>Thứ 2 - Thứ 6: 11h - 20h</li>\n<li>Thứ 7 &amp; Chủ nhật: 9h - 18h</li>\n</ul>\n<p><strong>Hình thức thanh toán:</strong> Chuyển khoản &amp; Tiền mặt</p>\n', 'data:image/png;base64,', '2024-08-21 13:30:26', '2024-08-21 13:30:26'),
(3, '414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh', 'Trung tâm xét nghiệm Diag Laboratories', 'Diag là một trong những trung tâm xét nghiệm uy tín tại Việt Nam với hơn 20 năm trong ngành dịch vụ y tế. Diag cung cấp giải pháp toàn diện cho các xét nghiệm y khoa, đảm bảo chất lượng chẩn đoán cho mọi bệnh nhân.\n\n* Dàn hệ thống máy xét nghiệm tự động đảm bảo kết quả nhanh chóng và chính xác.\n* Sử dụng kỹ thuật lấy máu chân không - giảm cảm giác đau, giảm nguy cơ vỡ ven và vỡ hồng cầu.\n* Danh mục xét nghiệm đa dạng phục vụ theo từng nhu cầu thăm khám, kiểm tra sức khỏe.\n* Mạng lưới cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.\n* Các kết quả trong phòng thí nghiệm được quản lý thông qua hệ thống nội kiểm (IQC) và ngoại kiểm (EQC) giúp quá trình xét nghiệm và trả kết quả được chính xác.\n* Trung tâm xét nghiệm Diag Laboratories được trang bị phòng xét nghiệm tân tiến với nhiều thiết bị, máy móc hiện đại, dàn hệ thống máy xét nghiệm tự động hiện đại của hãng Abbott. Các trang thiết bị khác của phòng xét nghiệm Diag đều đến từ các thương hiệu nổi tiếng, hiện đại và chuẩn quốc tế như Roche, Sysmex, Thermo Fisher, Arkray.\n\n**Địa chỉ:** Trụ sở chính nằm tại 414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh\n\nTrung tâm xét nghiệm Diag Laboratories với mạng lưới hơn 30 cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.\n\n\n**Thời gian làm việc**: \n\n\n\n* Giờ mở cửa: 6h00 mỗi ngày\n* Giờ đóng cửa:\n\n* Thứ 7: 19h00 hoặc 21h00 (Tùy từng cơ sở)\n* Chủ nhật: 12h00 hoặc 15h00 (Tùy từng cơ sở), cơ sở Quận 10: 19h00\n\n\n**Hình thức thanh toán**: \n\n* Trung tâm nhận thanh toán: Tiền mặt, chuyển khoản, thanh toán thẻ\n* Trung tâm có xuất hóa đơn đỏ trong vòng 24 giờ', '<p>Diag là một trong những trung tâm xét nghiệm uy tín tại Việt Nam với hơn 20 năm trong ngành dịch vụ y tế. Diag cung cấp giải pháp toàn diện cho các xét nghiệm y khoa, đảm bảo chất lượng chẩn đoán cho mọi bệnh nhân.</p>\n<ul>\n<li>Dàn hệ thống máy xét nghiệm tự động đảm bảo kết quả nhanh chóng và chính xác.</li>\n<li>Sử dụng kỹ thuật lấy máu chân không - giảm cảm giác đau, giảm nguy cơ vỡ ven và vỡ hồng cầu.</li>\n<li>Danh mục xét nghiệm đa dạng phục vụ theo từng nhu cầu thăm khám, kiểm tra sức khỏe.</li>\n<li>Mạng lưới cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.</li>\n<li>Các kết quả trong phòng thí nghiệm được quản lý thông qua hệ thống nội kiểm (IQC) và ngoại kiểm (EQC) giúp quá trình xét nghiệm và trả kết quả được chính xác.</li>\n<li>Trung tâm xét nghiệm Diag Laboratories được trang bị phòng xét nghiệm tân tiến với nhiều thiết bị, máy móc hiện đại, dàn hệ thống máy xét nghiệm tự động hiện đại của hãng Abbott. Các trang thiết bị khác của phòng xét nghiệm Diag đều đến từ các thương hiệu nổi tiếng, hiện đại và chuẩn quốc tế như Roche, Sysmex, Thermo Fisher, Arkray.</li>\n</ul>\n<p><strong>Địa chỉ:</strong> Trụ sở chính nằm tại 414 - 420 Cao Thắng, Phường 12, Quận 10, TP. Hồ Chí Minh</p>\n<p>Trung tâm xét nghiệm Diag Laboratories với mạng lưới hơn 30 cơ sở lấy mẫu xét nghiệm rộng lớn trên các quận và một số tỉnh thành miền nam Việt Nam - thuận tiện cho việc di chuyển.</p>\n<p><strong>Thời gian làm việc</strong>:</p>\n<ul>\n<li>\n<p>Giờ mở cửa: 6h00 mỗi ngày</p>\n</li>\n<li>\n<p>Giờ đóng cửa:</p>\n</li>\n<li>\n<p>Thứ 7: 19h00 hoặc 21h00 (Tùy từng cơ sở)</p>\n</li>\n<li>\n<p>Chủ nhật: 12h00 hoặc 15h00 (Tùy từng cơ sở), cơ sở Quận 10: 19h00</p>\n</li>\n</ul>\n<p><strong>Hình thức thanh toán</strong>:</p>\n<ul>\n<li>Trung tâm nhận thanh toán: Tiền mặt, chuyển khoản, thanh toán thẻ</li>\n<li>Trung tâm có xuất hóa đơn đỏ trong vòng 24 giờ</li>\n</ul>\n', 'data:image/png;base64,', '2024-08-21 13:32:45', '2024-08-21 13:32:45');
