(4, '135B Trần Bình Trọng, Phường 2, Quận 5, TP. HCM', 'Bệnh viện Chuyên khoa Mắt Cao Thắng', '**Bệnh viện Mắt Cao Thắng** là một trong những cơ sở khám và điều trị về chuyên khoa Mắt có uy tín tại TP. Hồ Chí Minh. Năm 2009, bệnh viện đạt tiêu chuẩn JCI của Mỹ đánh dấu cột mốc là bệnh viện đầu tiên đạt được tiêu chuẩn này tại Việt Nam. Ngoài ra Bệnh viện còn là thành viên của WAEH (World Association of Eye Hospitals), thành viên của AAEH (Asean Association of Eye Hospitals).\n\nBệnh viện Mắt Cao Thắng quy tụ đội ngũ bác sĩ giỏi, có nhiều năm kinh nghiệm trong việc khám, chữa các bệnh lý về mắt với nhiều năm đào tạo chuyên sâu trong nước và quốc tế. Bên cạnh đó, bệnh viện còn có sự cộng tác của các chuyên gia nước ngoài trong chẩn đoán các ca khó.\n\nBệnh viện được trang bị đầy đủ các thiết bị y tế hiện đại giúp cho việc chẩn đoán bệnh chính xác và nhanh chóng hơn như:\n\n* Hệ thống điều trị Laser 532\n* Hệ thống chụp mạch huỳnh quang\n* Máy Slitlamp (Nidex) dùng trong khám mắt\n* Hệ thống máy DORC EVA CV 30000 (Nidex)\n* OCT Canon, Nidex: thu được chất lượng hình ảnh cao (OCT HS100)…\n\n**Địa chỉ**: \n\n* Trụ sở chính: 135B Trần Bình Trọng, Phường 2, Quận 5, TP. Hồ Chí Minh\n* Phòng khám: Tầng 5, tòa nhà Citilight 45 Võ Thị Sáu, Phường Đa Kao, Quận 1, TP. Hồ Chí Minh\n\nThời gian làm việc:\n\n**Trụ sở chính**:\n* Thứ Hai - Thứ Bảy: 7:00 - 17:00\n* Chủ Nhật: 8:00 - 12:00\n\n**Phòng khám**: \n* Thứ Hai - Thứ Bảy : 8:00 - 17:00\n\n**Thông tin thanh toán và Bảo hiểm**:\n\n* Bệnh viện có sử dụng bảo hiểm bảo lãnh cho bệnh nhân nội trú\n* Bệnh viện có xuất hóa đơn đỏ\n* Hình thức thanh toán: tiền mặt, quẹt thẻ, vn pay,..', '<p><strong>Bệnh viện Mắt Cao Thắng</strong> là một trong những cơ sở khám và điều trị về chuyên khoa Mắt có uy tín tại TP. Hồ Chí Minh. Năm 2009, bệnh viện đạt tiêu chuẩn JCI của Mỹ đánh dấu cột mốc là bệnh viện đầu tiên đạt được tiêu chuẩn này tại Việt Nam. Ngoài ra Bệnh viện còn là thành viên của WAEH (World Association of Eye Hospitals), thành viên của AAEH (Asean Association of Eye Hospitals).</p>\n<p>Bệnh viện Mắt Cao Thắng quy tụ đội ngũ bác sĩ giỏi, có nhiều năm kinh nghiệm trong việc khám, chữa các bệnh lý về mắt với nhiều năm đào tạo chuyên sâu trong nước và quốc tế. Bên cạnh đó, bệnh viện còn có sự cộng tác của các chuyên gia nước ngoài trong chẩn đoán các ca khó.</p>\n<p>Bệnh viện được trang bị đầy đủ các thiết bị y tế hiện đại giúp cho việc chẩn đoán bệnh chính xác và nhanh chóng hơn như:</p>\n<ul>\n<li>Hệ thống điều trị Laser 532</li>\n<li>Hệ thống chụp mạch huỳnh quang</li>\n<li>Máy Slitlamp (Nidex) dùng trong khám mắt</li>\n<li>Hệ thống máy DORC EVA CV 30000 (Nidex)</li>\n<li>OCT Canon, Nidex: thu được chất lượng hình ảnh cao (OCT HS100)…</li>\n</ul>\n<p><strong>Địa chỉ</strong>:</p>\n<ul>\n<li>Trụ sở chính: 135B Trần Bình Trọng, Phường 2, Quận 5, TP. Hồ Chí Minh</li>\n<li>Phòng khám: Tầng 5, tòa nhà Citilight 45 Võ Thị Sáu, Phường Đa Kao, Quận 1, TP. Hồ Chí Minh</li>\n</ul>\n<p>Thời gian làm việc:</p>\n<p><strong>Trụ sở chính</strong>:</p>\n<ul>\n<li>Thứ Hai - Thứ Bảy: 7:00 - 17:00</li>\n<li>Chủ Nhật: 8:00 - 12:00</li>\n</ul>\n<p><strong>Phòng khám</strong>:</p>\n<ul>\n<li>Thứ Hai - Thứ Bảy : 8:00 - 17:00</li>\n</ul>\n<p><strong>Thông tin thanh toán và Bảo hiểm</strong>:</p>\n<ul>\n<li>Bệnh viện có sử dụng bảo hiểm bảo lãnh cho bệnh nhân nội trú</li>\n<li>Bệnh viện có xuất hóa đơn đỏ</li>\n<li>Hình thức thanh toán: tiền mặt, quẹt thẻ, vn pay,..</li>\n</ul>\n', 'data:image/jpeg;base64,', '2024-08-21 13:34:54', '2024-08-21 13:34:54');
