(5, 'Số 37 Hoàng Hoa Thám, Phường 13, Tân Bình, Thành phố Hồ Chí Minh', 'Phòng khám Đa khoa Quốc tế Golden Healthcare', '**Golden Healthcare** là phòng khám đa khoa cung cấp dịch vụ chăm sóc sức khỏe toàn diện và điều trị y tế tận tâm, an toàn cho bệnh nhân và gia đình bệnh nhân.\n\nCác bác sĩ tại phòng khám đều có ít nhất 15 năm kinh nghiệm, đã và đang công tác tại những bệnh viện lớn như: Bệnh viện Chợ Rẫy, Bệnh viện Nguyễn Tri Phương, Bệnh viện Thống Nhất, Bệnh viện Tai Mũi Họng TP.HCM, Bệnh viện Nhi Đồng...\n\nNgoài ra, phòng khám có trang bị các máy móc, thiết bị hiện đại đáp ứng được nhu cầu thăm khám các bệnh lý như: Tiêu hóa, Tai Mũi Họng, Sản phụ khoa, Nhi khoa, Mắt, Nội khoa, Khám tổng quát... \n\n**Địa chỉ**: Số 37 Hoàng Hoa Thám, Phường 13, Tân Bình, Thành phố Hồ Chí Minh\n\n**Thời gian làm việc**: \n\n* Thứ 2 đến thứ 7\n* Buổi sáng: 7h30 - 11h30\n* Buổi chiều: 13h00 - 17h00\n\n**Bảo hiểm áp dụng**\n\n* Bảo hiểm Y tế nhà nước\n* Bảo hiểm tư nhân: bảo hiểm bảo lãnh trực tiếp và bảo hiểm không bảo lãnh trực tiếp.\n\n**Hình thức thanh toán**\n\n* Phòng khám có thanh toán bằng hình thức tiền mặt, chuyển khoản và quẹt thẻ.\n* Phòng khám có xuất hóa đơn đỏ.', '<p><strong>Golden Healthcare</strong> là phòng khám đa khoa cung cấp dịch vụ chăm sóc sức khỏe toàn diện và điều trị y tế tận tâm, an toàn cho bệnh nhân và gia đình bệnh nhân.</p>\n<p>Các bác sĩ tại phòng khám đều có ít nhất 15 năm kinh nghiệm, đã và đang công tác tại những bệnh viện lớn như: Bệnh viện Chợ Rẫy, Bệnh viện Nguyễn Tri Phương, Bệnh viện Thống Nhất, Bệnh viện Tai Mũi Họng TP.HCM, Bệnh viện Nhi Đồng...</p>\n<p>Ngoài ra, phòng khám có trang bị các máy móc, thiết bị hiện đại đáp ứng được nhu cầu thăm khám các bệnh lý như: Tiêu hóa, Tai Mũi Họng, Sản phụ khoa, Nhi khoa, Mắt, Nội khoa, Khám tổng quát...</p>\n<p><strong>Địa chỉ</strong>: Số 37 Hoàng Hoa Thám, Phường 13, Tân Bình, Thành phố Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc</strong>:</p>\n<ul>\n<li>Thứ 2 đến thứ 7</li>\n<li>Buổi sáng: 7h30 - 11h30</li>\n<li>Buổi chiều: 13h00 - 17h00</li>\n</ul>\n<p><strong>Bảo hiểm áp dụng</strong></p>\n<ul>\n<li>Bảo hiểm Y tế nhà nước</li>\n<li>Bảo hiểm tư nhân: bảo hiểm bảo lãnh trực tiếp và bảo hiểm không bảo lãnh trực tiếp.</li>\n</ul>\n<p><strong>Hình thức thanh toán</strong></p>\n<ul>\n<li>Phòng khám có thanh toán bằng hình thức tiền mặt, chuyển khoản và quẹt thẻ.</li>\n<li>Phòng khám có xuất hóa đơn đỏ.</li>\n</ul>\n', 'data:image/png;base64,', '2024-08-21 13:36:51', '2024-08-21 13:36:51'),
(6, ' 111 Nguyễn Thị Thập, Khu dân cư Him Lam, Phường Tân Hưng, Quận 7, Thành phố Hồ Chí Minh ', 'Hệ thống phòng khám Sản phụ khoa Dr.Marie  ', '**Hệ thống phòng khám sản phụ khoa Marie Stopes Việt Nam** – Nay là Dr.Marie được xây dựng và kiểm định chất lượng bởi tổ chức MSI Reproductive Choices đến từ Anh Quốc. Dr.Marie là một trong những hệ thống phòng khám sản phụ khoa lớn tại Việt Nam với 12 phòng khám tại 9 tỉnh thành phố.\n\nĐội ngũ nhân viên của Dr.Marie được đào tạo và kiểm định chất lượng cung cấp dịch vụ định kỳ, đảm bảo đáp ứng tiêu chuẩn chất lượng cao nhất của Tổ chức Y tế Thế giới WHO, Tổ chức MSI Reproductive Choices và Bộ Y tế Việt Nam. Với nguyên tắc lấy Khách hàng là trọng tâm, Dr.Marie đảm bảo cung cấp dịch vụ chất lượng, an toàn và bảo mật, chăm sóc sức khỏe phụ nữ toàn diện từ kỳ kinh nguyệt đầu tiên cho tới giai đoạn mãn kinh.\n\nCác phòng khám được nâng cấp về cơ sở vật chất, trang thiết bị và đội ngũ nhân viên được tập huấn liên tục theo các tiêu chuẩn lâm sàng và chăm sóc khách hàng ngặt nghèo của tổ chức. Phòng khám Dr.Marie diện mạo mới năng động, hiện đại, với các dich vụ đa dạng và toàn diện hơn cho phụ nữ mọi lứa tuổi.\n\n**Địa chỉ**: Với 11 phòng khám tại 9 tỉnh, thành phố trên cả nước bao gồm Hà Nội, Hồ Chí Minh, Đà Nẵng, Nha Trang, Nghệ An, Hà Tĩnh, Bình Dương, Đồng Nai, Cần Thơ\n\n**Thời gian làm việc**: Thời gian làm việc tùy cơ sở, chi nhánh. Thông thường giờ làm việc như sau: \n\n* Thứ 2 - Thứ 6: 08:00 - 18:00\n* Thứ 7 - Chủ nhật: 08:00 - 17:00\n\n**Hình thức thanh toán**: Tiền mặt, Chuyển khoản, VNPay, Momo, VISA, Mastercard\n\n**Bảo hiểm áp dụng**: Có hóa đơn đỏ (hỗ trợ Khách hàng lấy dữ liệu làm hồ sơ làm bảo hiểm)', '<p><strong>Hệ thống phòng khám sản phụ khoa Marie Stopes Việt Nam</strong> – Nay là Dr.Marie được xây dựng và kiểm định chất lượng bởi tổ chức MSI Reproductive Choices đến từ Anh Quốc. Dr.Marie là một trong những hệ thống phòng khám sản phụ khoa lớn tại Việt Nam với 12 phòng khám tại 9 tỉnh thành phố.</p>\n<p>Đội ngũ nhân viên của Dr.Marie được đào tạo và kiểm định chất lượng cung cấp dịch vụ định kỳ, đảm bảo đáp ứng tiêu chuẩn chất lượng cao nhất của Tổ chức Y tế Thế giới WHO, Tổ chức MSI Reproductive Choices và Bộ Y tế Việt Nam. Với nguyên tắc lấy Khách hàng là trọng tâm, Dr.Marie đảm bảo cung cấp dịch vụ chất lượng, an toàn và bảo mật, chăm sóc sức khỏe phụ nữ toàn diện từ kỳ kinh nguyệt đầu tiên cho tới giai đoạn mãn kinh.</p>\n<p>Các phòng khám được nâng cấp về cơ sở vật chất, trang thiết bị và đội ngũ nhân viên được tập huấn liên tục theo các tiêu chuẩn lâm sàng và chăm sóc khách hàng ngặt nghèo của tổ chức. Phòng khám Dr.Marie diện mạo mới năng động, hiện đại, với các dich vụ đa dạng và toàn diện hơn cho phụ nữ mọi lứa tuổi.</p>\n<p><strong>Địa chỉ</strong>: Với 11 phòng khám tại 9 tỉnh, thành phố trên cả nước bao gồm Hà Nội, Hồ Chí Minh, Đà Nẵng, Nha Trang, Nghệ An, Hà Tĩnh, Bình Dương, Đồng Nai, Cần Thơ</p>\n<p><strong>Thời gian làm việc</strong>: Thời gian làm việc tùy cơ sở, chi nhánh. Thông thường giờ làm việc như sau:</p>\n<ul>\n<li>Thứ 2 - Thứ 6: 08:00 - 18:00</li>\n<li>Thứ 7 - Chủ nhật: 08:00 - 17:00</li>\n</ul>\n<p><strong>Hình thức thanh toán</strong>: Tiền mặt, Chuyển khoản, VNPay, Momo, VISA, Mastercard</p>\n<p><strong>Bảo hiểm áp dụng</strong>: Có hóa đơn đỏ (hỗ trợ Khách hàng lấy dữ liệu làm hồ sơ làm bảo hiểm)</p>\n', 'data:image/png;base64,', '2024-08-21 13:39:22', '2024-08-21 13:39:22');
INSERT INTO "Clinics" ("id", "address", "name", "descriptionMarkdown", "descriptionHTML", "image", "createdAt", "updatedAt") VALUES
(7, '224 Đường Nguyễn Lân, Phường Phương Liệt, Quận Thanh Xuân, Hà Nội', 'Phòng khám Da liễu Thẩm mỹ FSkin', '**Phòng khám Da liễu Thẩm mỹ FSkin** là nơi hội tụ đội ngũ bác sĩ giàu kinh nghiệm, giỏi chuyên môn để mang lại kết quả điều trị hiệu quả nhất và an toàn nhất cho từng khách hàng. 100% đội ngũ bác sĩ tại Fskin là bác sĩ chuyên khoa da liễu tốt nghiệp các trường Y danh tiếng, có kiến thức chuyên sâu về da liễu, mụn, sẹo, rám má... và các vấn đề thẩm mỹ da.  Các bác sĩ được cấp chứng chỉ hành nghề da liễu theo đúng quy định, cùng các chứng chỉ về thẩm mỹ (Mesotherapy trong thẩm mỹ da, Ứng dụng Botulinum toxin trong thẩm mỹ da, Tiêm chất làm đầy trong thẩm mỹ da, Căng chỉ trong thẩm mỹ da, Ứng dụng laser trong chuyên ngành da liễu).\n\nĐội ngũ bác sĩ giỏi, giàu kinh nghiệm lâu năm khám điều trị trong lĩnh vực da liễu\n\nThạc sĩ, Bác sĩ Nguyễn Thùy Linh - Gần 15 năm kinh nghiệm trong khám và điều trị về Da liễu, Phó Trưởng khoa Điều trị bệnh da phụ nữ và trẻ em Bệnh viện Da liễu Trung ương\nThạc sĩ, Bác sĩ Nội trú Nguyễn Thị Tuyến - Gần 15 năm kinh nghiệm trong lĩnh vực Da liễu, Trưởng phòng Đào tạo Bệnh viện Da liễu Trung Ương\nHệ thống trang thiết bị hiện đại đồng bộ phục vụ cho công tác chẩn đoán và điều trị hiệu quả\n\n**Địa chỉ**: 224 Đường Nguyễn Lân, Phường Phương Liệt, Quận Thanh Xuân, Hà Nội\n\n**Thời gian làm việc**:\n\n* Thứ 2 - Thứ 6: 16h30 – 20h00\n* Thứ 7, Chủ Nhật: 9h00 – 19h00\n\n**Phương thức thanh toán**:\n\n* Phòng khám nhận thanh toán bằng hình thức: Tiền mặt và chuyển khoản', '<p><strong>Phòng khám Da liễu Thẩm mỹ FSkin</strong> là nơi hội tụ đội ngũ bác sĩ giàu kinh nghiệm, giỏi chuyên môn để mang lại kết quả điều trị hiệu quả nhất và an toàn nhất cho từng khách hàng. 100% đội ngũ bác sĩ tại Fskin là bác sĩ chuyên khoa da liễu tốt nghiệp các trường Y danh tiếng, có kiến thức chuyên sâu về da liễu, mụn, sẹo, rám má... và các vấn đề thẩm mỹ da.  Các bác sĩ được cấp chứng chỉ hành nghề da liễu theo đúng quy định, cùng các chứng chỉ về thẩm mỹ (Mesotherapy trong thẩm mỹ da, Ứng dụng Botulinum toxin trong thẩm mỹ da, Tiêm chất làm đầy trong thẩm mỹ da, Căng chỉ trong thẩm mỹ da, Ứng dụng laser trong chuyên ngành da liễu).</p>\n<p>Đội ngũ bác sĩ giỏi, giàu kinh nghiệm lâu năm khám điều trị trong lĩnh vực da liễu</p>\n<p>Thạc sĩ, Bác sĩ Nguyễn Thùy Linh - Gần 15 năm kinh nghiệm trong khám và điều trị về Da liễu, Phó Trưởng khoa Điều trị bệnh da phụ nữ và trẻ em Bệnh viện Da liễu Trung ương\nThạc sĩ, Bác sĩ Nội trú Nguyễn Thị Tuyến - Gần 15 năm kinh nghiệm trong lĩnh vực Da liễu, Trưởng phòng Đào tạo Bệnh viện Da liễu Trung Ương\nHệ thống trang thiết bị hiện đại đồng bộ phục vụ cho công tác chẩn đoán và điều trị hiệu quả</p>\n<p><strong>Địa chỉ</strong>: 224 Đường Nguyễn Lân, Phường Phương Liệt, Quận Thanh Xuân, Hà Nội</p>\n<p><strong>Thời gian làm việc</strong>:</p>\n<ul>\n<li>Thứ 2 - Thứ 6: 16h30 – 20h00</li>\n<li>Thứ 7, Chủ Nhật: 9h00 – 19h00</li>\n</ul>\n<p><strong>Phương thức thanh toán</strong>:</p>\n<ul>\n<li>Phòng khám nhận thanh toán bằng hình thức: Tiền mặt và chuyển khoản</li>\n</ul>\n', 'data:image/png;base64,', '2024-08-21 13:41:21', '2024-08-21 13:41:21');
