(8, 'Số 88, Đường số 8, Khu dân cư Trung Sơn, Xã Bình Hưng, Huyện Bình Chánh, TP. Hồ Chí Minh', 'Bệnh viện Đa khoa Quốc Tế Nam Sài Gòn', 'Bệnh viện Đa khoa Quốc Tế Nam Sài Gòn có đội ngũ bác sĩ, chuyên viên y tế chuyên môn cao, bệnh viện còn hợp tác với các chuyên gia hàng đầu trong các lĩnh vực chuyên khoa. Trang thiết bị khám bệnh hiện đại, đặc biệt Bệnh viện Đa khoa Quốc Tế Nam Sài Gòn là đơn vị tư nhân đầu tiên ở khu vực phía Nam trang bị máy O-arm hiện đại giúp phẫu thuật cột sống được chính xác hơn.\n\nĐội ngũ bác sĩ giỏi, giàu kinh nghiệm\n\nBác sĩ Chuyên khoa II Võ Văn Mẫn - 30 năm kinh nghiệm về Chấn thương chỉnh hình, từng công tác tại nhiều bệnh viện lớn như Bệnh viện Chợ Rẫy, Bệnh viện Trưng Vương, Bệnh viện Sài Gòn ITO\nThạc sĩ, Bác sĩ Nguyễn Hữu Lĩnh - Gần 30 năm kinh nghiệm trong lĩnh vực Nhi khoa, nhiều năm công tác tại các bệnh viện lớn như: Bệnh viện Trung ương Huế, Bệnh viện FV và Family Medical Practice\nBác sĩ Chuyên khoa II Bùi Ngọc Phượng - 30 năm kinh nghiệm trong khám và điều trị Sản phụ khoa, Bác sĩ từng công tác 25 năm tại Bệnh viện Từ Dũ\nBác sĩ Chuyên khoa II Lê Văn Hiếu Nhân - Hơn 20 năm kinh nghiệm chuyên khoa Ngoại Tiết niệu, từng công tác tại Bệnh viện Bình Dân TP. HCM\n...\nHệ thống trang thiết bị hiện đại đáp ứng tiêu chí “Tiếp cận nhanh - Chẩn đoán chính xác - Điều trị kịp thời”\n\nHệ thống chụp cộng hưởng từ 1,5 Tesla Siemens magnetom amira với TIM+DOT.\nHệ thống chụp CT Scanner Siemens 64 lát cắt Siemens Definition AS - Cấu hình 64 lát cắt\nHệ thống O-Arm giúp phẫu thuật cột sống được chính xác hơn và tránh được những tai biến có thể xảy ra\n...\n**Địa chỉ**: Số 88, Đường số 8, Khu dân cư Trung Sơn, Xã Bình Hưng, Huyện Bình Chánh, TP. Hồ Chí Minh\n\n**Thời gian làm việc**:\n\n* Từ Thứ 2 đến Thứ 7\n* Sáng: 7h00 - 12h\n* Chiều: 13h30 - 17h\n\n**Lưu ý quan trọng** \n\nKhách hàng báo với quầy lễ tân đăng ký khám bệnh theo lịch đặt hẹn trước\nHình thức thanh toán: Bệnh nhân đến khám tại bệnh viện có thể thanh toán chi phí khám bệnh bằng tiền mặt, qua ngân hàng, hoặc quét mã QR', '<p>Bệnh viện Đa khoa Quốc Tế Nam Sài Gòn có đội ngũ bác sĩ, chuyên viên y tế chuyên môn cao, bệnh viện còn hợp tác với các chuyên gia hàng đầu trong các lĩnh vực chuyên khoa. Trang thiết bị khám bệnh hiện đại, đặc biệt Bệnh viện Đa khoa Quốc Tế Nam Sài Gòn là đơn vị tư nhân đầu tiên ở khu vực phía Nam trang bị máy O-arm hiện đại giúp phẫu thuật cột sống được chính xác hơn.</p>\n<p>Đội ngũ bác sĩ giỏi, giàu kinh nghiệm</p>\n<p>Bác sĩ Chuyên khoa II Võ Văn Mẫn - 30 năm kinh nghiệm về Chấn thương chỉnh hình, từng công tác tại nhiều bệnh viện lớn như Bệnh viện Chợ Rẫy, Bệnh viện Trưng Vương, Bệnh viện Sài Gòn ITO\nThạc sĩ, Bác sĩ Nguyễn Hữu Lĩnh - Gần 30 năm kinh nghiệm trong lĩnh vực Nhi khoa, nhiều năm công tác tại các bệnh viện lớn như: Bệnh viện Trung ương Huế, Bệnh viện FV và Family Medical Practice\nBác sĩ Chuyên khoa II Bùi Ngọc Phượng - 30 năm kinh nghiệm trong khám và điều trị Sản phụ khoa, Bác sĩ từng công tác 25 năm tại Bệnh viện Từ Dũ\nBác sĩ Chuyên khoa II Lê Văn Hiếu Nhân - Hơn 20 năm kinh nghiệm chuyên khoa Ngoại Tiết niệu, từng công tác tại Bệnh viện Bình Dân TP. HCM\n...\nHệ thống trang thiết bị hiện đại đáp ứng tiêu chí “Tiếp cận nhanh - Chẩn đoán chính xác - Điều trị kịp thời”</p>\n<p>Hệ thống chụp cộng hưởng từ 1,5 Tesla Siemens magnetom amira với TIM+DOT.\nHệ thống chụp CT Scanner Siemens 64 lát cắt Siemens Definition AS - Cấu hình 64 lát cắt\nHệ thống O-Arm giúp phẫu thuật cột sống được chính xác hơn và tránh được những tai biến có thể xảy ra\n...\n<strong>Địa chỉ</strong>: Số 88, Đường số 8, Khu dân cư Trung Sơn, Xã Bình Hưng, Huyện Bình Chánh, TP. Hồ Chí Minh</p>\n<p><strong>Thời gian làm việc</strong>:</p>\n<ul>\n<li>Từ Thứ 2 đến Thứ 7</li>\n<li>Sáng: 7h00 - 12h</li>\n<li>Chiều: 13h30 - 17h</li>\n</ul>\n<p><strong>Lưu ý quan trọng</strong></p>\n<p>Khách hàng báo với quầy lễ tân đăng ký khám bệnh theo lịch đặt hẹn trước\nHình thức thanh toán: Bệnh nhân đến khám tại bệnh viện có thể thanh toán chi phí khám bệnh bằng tiền mặt, qua ngân hàng, hoặc quét mã QR</p>\n', 'data:image/png;base64,', '2024-08-21 13:42:48', '2024-08-21 13:42:48');
