(3, '<p><strong>Bác sĩ Chuyên khoa II Lê Nhật Vinh</strong></p>\n<ul>\n<li>Hơn 10 năm kinh nghiệm lĩnh vực Tai mũi họng</li>\n<li>Từng công tác tại Bệnh viện Thống Nhất, Bệnh viện Tai mũi họng TP. HCM</li>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Viêm tai giữa: Đau tai, chảy dịch, nghe kém, ù tai</li>\n<li>Viêm mũi xoang: Đau đầu, ngạt mũi, chảy mủ</li>\n<li>Viêm mũi dị ứng: Hắt xì, chảy mũi, ngứa mũi, ngạt mũi</li>\n<li>Viêm họng: Đau rát họng, hôi miệng, vướng họng</li>\n<li>Viêm Amidan: Sốt, đau họng, ngủ ngáy</li>\n<li>Hội chứng trào ngược dạ dày thực quản: Vướng họng, thay đổi giọng nói</li>\n<li>Viêm mũi VA: Ngạt mũi, ngủ ngáy</li>\n<li>Viêm thanh quản: Khàn tiếng</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Học Chuyên khoa II tại bệnh viện Tai mũi họng và khoa Tai mũi họng của Bệnh viện Nhân dân Gia Định, Bệnh viện Trưng Vương, Bệnh viện Thống Nhất, Bệnh viện Nhân dân 115, Bệnh viện Nhi đồng 1 (2019 - 2022)</li>\n<li>Bác sĩ điều trị, khoa Tai mũi họng, Bệnh viện Thống Nhất (2016 - 2022)</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>\n<p>Bác sĩ Chuyên khoa II Chuyên ngành Tai mũi họng, Đại học Y khoa Phạm Ngọc Thạch (2022)</p>\n</li>\n<li>\n<p>Thạc sĩ - Bác sĩ Chuyên ngành Tai mũi họng, Đại học Y khoa Phạm Ngọc Thạch (2015)</p>\n</li>\n<li>\n<p>Bác sĩ Đa khoa, Đại học Y Dược TP. HCM (2011)</p>\n</li>\n</ul>\n<p><strong>Chứng chỉ trong và ngoài nước</strong></p>\n<ul>\n<li>Chứng chỉ thính học cơ bản, Đại học Y dược TP. HCM (2016)</li>\n<li>Chứng chỉ Nội soi chẩn đoán và phẫu thuật nội soi cơ bản Tai mũi họng, Đại học Y dược TP. HCM (2014)</li>\n</ul>\n', '**Bác sĩ Chuyên khoa II Lê Nhật Vinh**\n\n* Hơn 10 năm kinh nghiệm lĩnh vực Tai mũi họng\n* Từng công tác tại Bệnh viện Thống Nhất, Bệnh viện Tai mũi họng TP. HCM\n* Bác sĩ nhận khám mọi độ tuổi\n\n**Khám và điều trị**\n\n\n* Viêm tai giữa: Đau tai, chảy dịch, nghe kém, ù tai\n* Viêm mũi xoang: Đau đầu, ngạt mũi, chảy mủ\n* Viêm mũi dị ứng: Hắt xì, chảy mũi, ngứa mũi, ngạt mũi\n* Viêm họng: Đau rát họng, hôi miệng, vướng họng\n* Viêm Amidan: Sốt, đau họng, ngủ ngáy\n* Hội chứng trào ngược dạ dày thực quản: Vướng họng, thay đổi giọng nói\n* Viêm mũi VA: Ngạt mũi, ngủ ngáy\n* Viêm thanh quản: Khàn tiếng\n\n\n\n\n**Quá trình công tác**\n\n### Một số hình ảnh \n\n\n![](https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/a1.jpg?raw=true)\n* Học Chuyên khoa II tại bệnh viện Tai mũi họng và khoa Tai mũi họng của Bệnh viện Nhân dân Gia Định, Bệnh viện Trưng Vương, Bệnh viện Thống Nhất, Bệnh viện Nhân dân 115, Bệnh viện Nhi đồng 1 (2019 - 2022)\n* Bác sĩ điều trị, khoa Tai mũi họng, Bệnh viện Thống Nhất (2016 - 2022)\n\n\n**Quá trình đào tạo**\n\n* Bác sĩ Chuyên khoa II Chuyên ngành Tai mũi họng, Đại học Y khoa Phạm Ngọc Thạch (2022)\n\n* Thạc sĩ - Bác sĩ Chuyên ngành Tai mũi họng, Đại học Y khoa Phạm Ngọc Thạch (2015)\n\n* Bác sĩ Đa khoa, Đại học Y Dược TP. HCM (2011)\n\n**Chứng chỉ trong và ngoài nước**\n\n\n* Chứng chỉ thính học cơ bản, Đại học Y dược TP. HCM (2016)\n* Chứng chỉ Nội soi chẩn đoán và phẫu thuật nội soi cơ bản Tai mũi họng, Đại học Y dược TP. HCM (2014)\n\n\n', 'Hơn 10 năm kinh nghiệm lĩnh vực Tai mũi họng\nTừng công tác tại Bệnh viện Thống Nhất\nBác sĩ nhận khám mọi độ tuổi', 2, NULL, NULL, '2024-05-20 13:46:57', '2024-05-20 20:44:09'),
(4, '<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn</li>\n<li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em</li>\n<li>Nội soi Tai Mũi Họng</li>\n<li>Thực hiện các qui trình kỹ thuật Tai Mũi Họng</li>\n</ul>\n<p><strong>Các bệnh về tai</strong></p>\n<ul>\n<li>Ù tai, nghe kém, điếc đột ngột</li>\n<li>Chẩy mủ tai, viêm tai giữa cấp, mạn</li>\n<li>Vá màng nhĩ nội soi</li>\n<li>Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài</li>\n</ul>\n<p><strong>Đào tạo nâng cao</strong></p>\n<ul>\n<li>Phẫu thuật Đầu cổ trên xác ở Bệnh viện Rajavithi, Băng Cốc, Thái Lan (2019)</li>\n<li>Phẫu thuật điều trị ngáy và ngưng thở khi ngủ do tắc nghẽn, phẫu thuật xoang và sàn sọ, Đại Học Stanford, California, Mỹ (2017)</li>\n<li>Nghiên cứu lâm sàng trong Tai Mũi Họng, Bệnh viện Chang Gung Cao Hung, Cao Hùng, Đài Loan (2016)</li>\n<li>Học kỹ thuật phẫu thuật điều trị ngáy và ngưng thở khi ngủ do tắc nghẽn nâng cao tại Bệnh viện SGH Singapore (2013)</li>\n<li>Phẫu thuật nội soi mũi xoang và sàn sọ, Bộ môn Tai Mũi Họng, Khoa Y, Trường Đại Học Bắc Carolina, Mỹ (2012)</li>\n<li>Kỹ thuật phẫu thuật cấy ghép thiết bị nghe nâng cao, Bệnh viện đa khoa Cheng Hsin, Đài Loan (2011)</li>\n<li>Phẫu thuật Phục hồi và Phẫu thuật thẩm mỹ vùng mặt, Đại học Y Dược Thành phố Hồ Chí Minh (2001)</li>\n</ul>\n', '\n**Khám và điều trị**\n\n* Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn\n* Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em\n* Nội soi Tai Mũi Họng\n* Thực hiện các qui trình kỹ thuật Tai Mũi Họng\n\n**Các bệnh về tai**\n\n* Ù tai, nghe kém, điếc đột ngột\n* Chẩy mủ tai, viêm tai giữa cấp, mạn\n* Vá màng nhĩ nội soi\n* Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài\n\n\n\n**Đào tạo nâng cao**\n\n* Phẫu thuật Đầu cổ trên xác ở Bệnh viện Rajavithi, Băng Cốc, Thái Lan (2019)\n* Phẫu thuật điều trị ngáy và ngưng thở khi ngủ do tắc nghẽn, phẫu thuật xoang và sàn sọ, Đại Học Stanford, California, Mỹ (2017)\n* Nghiên cứu lâm sàng trong Tai Mũi Họng, Bệnh viện Chang Gung Cao Hung, Cao Hùng, Đài Loan (2016)\n* Học kỹ thuật phẫu thuật điều trị ngáy và ngưng thở khi ngủ do tắc nghẽn nâng cao tại Bệnh viện SGH Singapore (2013)\n* Phẫu thuật nội soi mũi xoang và sàn sọ, Bộ môn Tai Mũi Họng, Khoa Y, Trường Đại Học Bắc Carolina, Mỹ (2012)\n* Kỹ thuật phẫu thuật cấy ghép thiết bị nghe nâng cao, Bệnh viện đa khoa Cheng Hsin, Đài Loan (2011)\n* Phẫu thuật Phục hồi và Phẫu thuật thẩm mỹ vùng mặt, Đại học Y Dược Thành phố Hồ Chí Minh (2001)', 'Hơn 20 năm kinh nghiệm trong lĩnh vực Tai Mũi Họng\nGiám Đốc chuyên môn Bệnh viện Đa khoa Quốc tế Nam Sài Gòn\nTrưởng khoa Tai Mũi Họng, Bệnh viện Đa khoa Quốc tế Nam Sài Gòn\nBác sĩ nhận khám mọi độ tuổi', 6, NULL, NULL, '2024-05-20 20:09:59', '2024-05-20 20:09:59'),
(5, '<p><strong>Giới thiệu chung</strong></p>\n<ul>\n<li>Gần 20 năm kinh nghiệm chuyên khoa Ngoại Thần kinh</li>\n<li>Phó Trưởng khoa Ngoại thần kinh, Bệnh viện Nam Sài Gòn</li>\n<li>Bác sĩ khám bằng ngôn ngữ Tiếng Anh và Tiếng Việt</li>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n</ul>\n<p><strong><strong>Khám và điều trị</strong></strong></p>\n<p><strong>Các bệnh lý não</strong></p>\n<ul>\n<li>Phẫu thuật lấy máu tụ trong sọ não (Intracranial Hematoma)</li>\n<li>Phẫu thuật vi phẫu các u trong não (Microsurgery for brain tumors)</li>\n<li>Phẫu thuật vi phẫu các bệnh lý mạch máu não (Túi phình mạch máu não, Dị dạng mạch máu) (Microsurgery for vascular diseases: Aneurysms, AVMs)</li>\n<li>Phẫu thuật tạo hình khuyết sọ (Cranioplasty)</li>\n<li>Phẫu thuật nội soi hoặc vi phẫu lấy u tuyến yên (Endonasal or Microscope Transsphenoidal for removing the pituitary tumors)</li>\n<li>Phẫu thuật thần kinh có dẫn đường (Neuronavigation surgery)</li>\n<li>Phẫu thuật sinh thiết u não bằng khung định vị trong không gian 3 chiều (Stereotactic biopsy)</li>\n<li>Phẫu thuật áp xe não (Brain abscess surgery)</li>\n</ul>\n<p><strong>Các bệnh lý cột sống</strong></p>\n<ul>\n<li>Vi phẫu, nội soi lấy nhân thoát vị đĩa đệm, thay đĩa đệm cổ nhân tạo (Microdiscectomy and Endoscopic Surgery of the Lumbar, Thoracic and Cervical Spine)</li>\n<li>Phẫu thuật trượt, hẹp cột sống thắt lưng bằng phương pháp phẫu thuật can thiệp tối thiểu qua lỗ liên hợp - MIS TILF (Lumbar fusion for spondylolisthesis by MIS TILF)</li>\n<li>Vi phẫu thuật u tủy sống (Microsurgery for Spinal Tumors)</li>\n<li>Phẫu thuật hẹp ống sống cổ bằng phương pháp tạo hình bản sống (Laminoplasty for Cervical Canal Stenosis)</li>\n<li>Phẫu thuật gãy mỏm nha C2 (C2 fracture surgery)</li>\n<li>Phẫu thuật dị tật Arnold-Chiari, rỗng ống tủy, tủy bám thấp (Surgery for Arnold-Chiari Malformation, Syringomyelia)</li>\n<li>Phẫu thuật tạo hình thân sống qua da (Percutaneous Vertebroplasty)</li>\n</ul>\n<p><strong>Bệnh lý thần kinh ngoại biên</strong></p>\n<ul>\n<li>Chèn ép thần kinh ngoại biên (Peripheral nerve neurolysis): hội chứng ống cổ tay, chèn ép thần kinh trụ</li>\n</ul>\n<p><strong>Phẫu thuật thần kinh chức năng</strong></p>\n<ul>\n<li>Phẫu thuật điều trị đau dây thần kinh số V (Microvascular decompression for trigeminal neuralgia)</li>\n<li>Phẫu thuật điều trị co giật nửa mặt (Microvascular decompression for hemifacial spasm)</li>\n<li>Điều trị đau mạn tính vùng đầu-mặt và cột sống (Treatment for Chronic Neuropathic pain: Head-Face and Spine pain)</li>\n<li>Phẫu thuật cắt hồi hải mã chữa bệnh động kinh (Epilepsy Surgery)</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Bác sĩ khoa Ngoại Thần Kinh - Cột Sống, Bệnh viện Đa khoa Quốc tế Nam Sài Gòn (2023 - nay)</li>\n<li>Trưởng khoa Ngoại Thần Kinh - Cột Sống, Bệnh viện Đa khoa Quốc tế Nam Sài Gòn (2021 - 2023)</li>\n<li>Trưởng khoa Ngoại Thần kinh, Bệnh viện Đa khoa Quốc tế Vinmec Central Park, TP.HCM (2019 - 2020)</li>\n<li>Giám đốc chuyên môn, Trưởng khoa Ngoại thần kinh - Bệnh viện Nam Sài Gòn TP.HCM (2018 - 2019)</li>\n<li>Bác sĩ điều trị khoa Ngoại thần kinh, Bệnh viện Đa khoa Bình Định (2002 - 2018)</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Đào tạo Bác sĩ Chuyên khoa II Ngoại Thần kinh - Đại học Y dược thành phố Hồ Chí Minh (2018 - 2020)</li>\n<li>Đào tạo Thạc sĩ Ngoại Thần kinh, Đại học Y dược thành phố Hồ Chí Minh (2008 - 2010)</li>\n<li>Chuyên khoa Ngoại Thần kinh - Bệnh viện Chợ Rẫy (2003)</li>\n<li>Bác sĩ Đa khoa, Đại học Y dược Huế (2002)</li>\n</ul>\n<p><strong>Thành viên các Hội khoa học, tổ chức chuyên môn</strong></p>\n<ul>\n<li>Thành viên Hội Phẫu thuật Thần kinh Việt Nam (VNS)</li>\n<li>Thành viên Hội Cột sống Thành phố Hồ Chí Minh (SSHV)</li>\n<li>Thành viên Hội Phẫu thuật Thần kinh Châu Á</li>\n<li>Thành viên Hội Phẫu thuật Thần kinh Thế giới (World Federation of Neurological Societies - WFNS)</li>\n<li>Thành viên Hội Phẫu thuật Cột sống Bắc Mỹ (NASS)</li>\n</ul>\n', ' \n\n **Giới thiệu chung**\n\n- Gần 20 năm kinh nghiệm chuyên khoa Ngoại Thần kinh\n- Phó Trưởng khoa Ngoại thần kinh, Bệnh viện Nam Sài Gòn\n- Bác sĩ khám bằng ngôn ngữ Tiếng Anh và Tiếng Việt\n- Bác sĩ nhận khám mọi độ tuổi\n\n****Khám và điều trị****\n\n **Các bệnh lý não**\n\n- Phẫu thuật lấy máu tụ trong sọ não (Intracranial Hematoma)\n- Phẫu thuật vi phẫu các u trong não (Microsurgery for brain tumors)\n- Phẫu thuật vi phẫu các bệnh lý mạch máu não (Túi phình mạch máu não, Dị dạng mạch máu) (Microsurgery for vascular diseases: Aneurysms, AVMs)\n- Phẫu thuật tạo hình khuyết sọ (Cranioplasty)\n- Phẫu thuật nội soi hoặc vi phẫu lấy u tuyến yên (Endonasal or Microscope Transsphenoidal for removing the pituitary tumors)\n- Phẫu thuật thần kinh có dẫn đường (Neuronavigation surgery)\n- Phẫu thuật sinh thiết u não bằng khung định vị trong không gian 3 chiều (Stereotactic biopsy)\n- Phẫu thuật áp xe não (Brain abscess surgery)\n\n**Các bệnh lý cột sống**\n\n- Vi phẫu, nội soi lấy nhân thoát vị đĩa đệm, thay đĩa đệm cổ nhân tạo (Microdiscectomy and Endoscopic Surgery of the Lumbar, Thoracic and Cervical Spine)\n- Phẫu thuật trượt, hẹp cột sống thắt lưng bằng phương pháp phẫu thuật can thiệp tối thiểu qua lỗ liên hợp - MIS TILF (Lumbar fusion for spondylolisthesis by MIS TILF)\n- Vi phẫu thuật u tủy sống (Microsurgery for Spinal Tumors)\n- Phẫu thuật hẹp ống sống cổ bằng phương pháp tạo hình bản sống (Laminoplasty for Cervical Canal Stenosis)\n- Phẫu thuật gãy mỏm nha C2 (C2 fracture surgery)\n- Phẫu thuật dị tật Arnold-Chiari, rỗng ống tủy, tủy bám thấp (Surgery for Arnold-Chiari Malformation, Syringomyelia)\n- Phẫu thuật tạo hình thân sống qua da (Percutaneous Vertebroplasty)\n\n**Bệnh lý thần kinh ngoại biên**\n\n- Chèn ép thần kinh ngoại biên (Peripheral nerve neurolysis): hội chứng ống cổ tay, chèn ép thần kinh trụ\n\n **Phẫu thuật thần kinh chức năng**\n\n- Phẫu thuật điều trị đau dây thần kinh số V (Microvascular decompression for trigeminal neuralgia)\n- Phẫu thuật điều trị co giật nửa mặt (Microvascular decompression for hemifacial spasm)\n- Điều trị đau mạn tính vùng đầu-mặt và cột sống (Treatment for Chronic Neuropathic pain: Head-Face and Spine pain)\n- Phẫu thuật cắt hồi hải mã chữa bệnh động kinh (Epilepsy Surgery)\n\n**Quá trình công tác**\n\n- Bác sĩ khoa Ngoại Thần Kinh - Cột Sống, Bệnh viện Đa khoa Quốc tế Nam Sài Gòn (2023 - nay)\n- Trưởng khoa Ngoại Thần Kinh - Cột Sống, Bệnh viện Đa khoa Quốc tế Nam Sài Gòn (2021 - 2023)\n- Trưởng khoa Ngoại Thần kinh, Bệnh viện Đa khoa Quốc tế Vinmec Central Park, TP.HCM (2019 - 2020)\n- Giám đốc chuyên môn, Trưởng khoa Ngoại thần kinh - Bệnh viện Nam Sài Gòn TP.HCM (2018 - 2019)\n- Bác sĩ điều trị khoa Ngoại thần kinh, Bệnh viện Đa khoa Bình Định (2002 - 2018)\n\n **Quá trình đào tạo**\n\n- Đào tạo Bác sĩ Chuyên khoa II Ngoại Thần kinh - Đại học Y dược thành phố Hồ Chí Minh (2018 - 2020)\n- Đào tạo Thạc sĩ Ngoại Thần kinh, Đại học Y dược thành phố Hồ Chí Minh (2008 - 2010)\n- Chuyên khoa Ngoại Thần kinh - Bệnh viện Chợ Rẫy (2003)\n- Bác sĩ Đa khoa, Đại học Y dược Huế (2002)\n\n\n\n **Thành viên các Hội khoa học, tổ chức chuyên môn**\n\n- Thành viên Hội Phẫu thuật Thần kinh Việt Nam (VNS)\n- Thành viên Hội Cột sống Thành phố Hồ Chí Minh (SSHV)\n- Thành viên Hội Phẫu thuật Thần kinh Châu Á\n- Thành viên Hội Phẫu thuật Thần kinh Thế giới (World Federation of Neurological Societies - WFNS)\n- Thành viên Hội Phẫu thuật Cột sống Bắc Mỹ (NASS)\n\nMột vài hình ảnh về phòng khám \n\n![img](https://github.com/haryphamdev/sharing-host-files/blob/master/detail-doctors/a1.jpg?raw=true)', '\nThạc sĩ, Bác sĩ Chuyên khoa II Đỗ Anh Vũ\nGần 20 năm kinh nghiệm chuyên khoa Ngoại Thần kinh\nPhó trưởng khoa Ngoại thần kinh, Bệnh viện Đa khoa Nam Sài Gòn\nBác sĩ nhận khám mọi độ tuổi', 4, NULL, NULL, '2024-05-20 20:19:49', '2024-05-20 20:33:10'),
(6, '<p>hjlashfajkld</p>\n', '**Quá trình công tác**\n\n* Phụ trách khoa Sức khỏe tâm thần, Bệnh viện Lão khoa (11/2021 - Nay)\n* Giảng viên - Giáo vụ Đại học Bộ môn Tâm thần, Đại học Y Hà Nội (09/2016 - Nay)\n* Phó khoa Sức khỏe tâm thần, Bệnh viện Lão khoa (02/2021 - 10/2021)\n* Bác sĩ điều trị khoa Sức khỏe tâm thần, Bệnh viện Lão khoa (07/2017 - 02/2021)\n* Bác sĩ điều trị Viện Sức Khoẻ Tâm thần, Bệnh viện Bạch Mai (03/2015 - 07/2017)\n* Giảng viên Đại học Bộ môn Tâm thần, Đại học Y Hà Nội (03/2015 - 09/2016)\n\n\n**Quá trình đào tạo**\n\n* Bác sĩ Chuyên khoa cấp II chuyên ngành Tâm thần, Đại học Y Hà Nội (2019 - 2021)\n* Thạc sĩ chuyên ngành Tâm thần, Đại học Y Hà Nội (2020 - 2021)\n* Bác sĩ Nội trú chuyên ngành Tâm thần, Đại học Y Hà Nội (2011 - 2014)\n* Bác sĩ Đa khoa, Đại học Y Hà Nội (2006 - 2011)\n\n**Chứng chỉ trong nước hoặc nước ngoài**\n\n* Chứng chỉ đào tạo lâm sàng tâm thần học , Đại học Sydney (2019)\n* Chứng chỉ đào tạo leadership, Indonesia, Tổ chức Y tế Thế giới (2018)\n\n**Giải thưởng**\n\n* Bằng khen của Bộ trưởng Bộ Y tế\n* Giấy khen Giám đốc Bệnh viện Bạch Mai\n* Giấy khen Giám đốc Bệnh viện Lão khoa\n* Bằng khen Hiệu trưởng Trường Đại Học Y Hà Nội dành cho Bác sĩ Nội trú tốt nghiệp Thủ khoa toàn khóa\n* Bằng khen của Thủ tướng Chính phủ dành cho thành viên đội tuyển tham dự Olympic Sinh Quốc tế\n* Và nhiều học bổng trong và ngoài nước\n*', 'Bác sĩ hà nội ', 5, NULL, NULL, '2024-08-20 20:28:23', '2024-08-21 14:51:46'),
(7, '<p>Bác sĩ chuyên khoa IIII</p>\n', '**Khám và điều trị**\n* Chấn thương khớp gối, vai, cột sống (trong tai nạn sinh hoạt, chấn thương thể thao)\n* Đứt dây chằng gối, dẹp rách sụn gối - trật khớp vai\n* Chấn thương đứt dây chằng khớp gối\n* Chấn thương rách đứt dây chằng cổ chân\n* Chấn thương rách lật khớp vai\n* Chấn thương rách gân khớp vai\n* Các bệnh lý đặc biệt trong thể thao\n* Bệnh thoái hóa cột sống, đĩa đệm, cổ tay\n* Bệnh lý khớp gối\n* Hội chứng Tennis Elbow (viêm lồi cầu ngoài xương cánh tay là chấn thương thường gặp ở người chơi tennis)\n* Gai gót chân\n* Bệnh lý gối lệch trục xương ( vẹo trong, vẹo ngoài )\n* Thoái hóa khớp háng\n\n**Quá trình công tác**\n* Bác sĩ Bộ môn Y học thể thao, Trường Đại học Y khoa Phạm Ngọc Thạch (1991 - 2018)\n* Bác sĩ Khoa Y học thể thao, Bệnh viện Nhân dân 115 (2005 - 2011)\n* Bác sĩ Khoa Chi dưới, Bệnh viện Chấn thương chỉnh hình TP.HCM (1991 - 2005)\n\n**Quá trình đào tạo**\n* Bác sĩ Chuyên khoa I Chuyên khoa Chấn thương chỉnh hình, Trường Đại học Y dược TP.HCM (1993 - 1995)\n* Bác sĩ Đa khoa, Trường Đại học Y dược TP.HCM (1984 - 1990)\n* Chứng chỉ nội soi khớp tại Đai học Chulalongkorn Thái Lan\n* Tập huấn về nội soi tại Singapore & Hàn Quốc', 'GS, TS, Bác sĩ chấn thương ', 7, NULL, NULL, '2024-08-21 08:34:22', '2024-08-21 14:53:10'),
(8, '<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Hiện là Giám đốc Phòng khám Chuyên khoa Nội An Phước (2018 - nay)</li>\n<li>Bác sĩ điều trị, khoa Tiêu hóa, Bệnh viện Nhân dân 115 (2004 - 2018)</li>\n<li>Bác sĩ nội soi tiêu hóa, khoa Nội soi, Bệnh viện Nhân dân 115 (2004 - 2018)</li>\n<li>Bác sĩ luân khoa, Bệnh viện Nhân dân 115 (2003 - 2004)</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Tốt nghiệp Thạc sĩ chuyên ngành Nội tổng quát, Đại học Y dược TPHCM (2012)</li>\n<li>Tốt nghiệp Bác sĩ đa khoa, Đại học Y khoa Phạm Ngọc Thạch (2002)</li>\n<li>Chứng chỉ Nội soi đại tràng, Bệnh viện Chợ Rẫy (2015)</li>\n<li>Chứng chỉ Nội soi dạ dày - tá tràng, Bệnh viện Nhân dân 115 (2014)</li>\n<li>Chứng chỉ Siêu âm tổng quát thực hành, Bệnh viện Đại học Y dược TPHCM (2005)</li>\n</ul>\n<p><strong>Thành viên các Hội khoa học, tổ chức chuyên môn</strong></p>\n<ul>\n<li>Hội Tiêu hóa - Gan mật</li>\n</ul>\n', '**Quá trình công tác**\n* Hiện là Giám đốc Phòng khám Chuyên khoa Nội An Phước (2018 - nay)\n* Bác sĩ điều trị, khoa Tiêu hóa, Bệnh viện Nhân dân 115 (2004 - 2018)\n* Bác sĩ nội soi tiêu hóa, khoa Nội soi, Bệnh viện Nhân dân 115 (2004 - 2018)\n* Bác sĩ luân khoa, Bệnh viện Nhân dân 115 (2003 - 2004)\n\n**Quá trình đào tạo**\n* Tốt nghiệp Thạc sĩ chuyên ngành Nội tổng quát, Đại học Y dược TPHCM (2012)\n* Tốt nghiệp Bác sĩ đa khoa, Đại học Y khoa Phạm Ngọc Thạch (2002)\n* Chứng chỉ Nội soi đại tràng, Bệnh viện Chợ Rẫy (2015)\n* Chứng chỉ Nội soi dạ dày - tá tràng, Bệnh viện Nhân dân 115 (2014)\n* Chứng chỉ Siêu âm tổng quát thực hành, Bệnh viện Đại học Y dược TPHCM (2005)\n\n**Thành viên các Hội khoa học, tổ chức chuyên môn**\n* Hội Tiêu hóa - Gan mật\n', 'Giám đốc Phòng khám Chuyên khoa Nội An Phước', 8, NULL, NULL, '2024-08-21 14:55:54', '2024-08-21 14:55:54');
